import React from 'react';

class Profile extends React.Component {

  constructor(props) {
    super(props);
    this.profile = props.profile;
  }


  render() {
    return (
      <div className='profile-bio'>
        <p>{this.profile}</p>
      </div>
    );
  }
}

export default Profile;
